import axios from "axios";
import authHeader from "./auth-header";

const API_URL = "http:localhost:3001/api/v1/";

const UserService = {
  getUserDash() {
    return axios.get(API_URL + "user/home", { header: authHeader() });
  },
  //  function for creating a workout
  saveWorkout(workout) {
    return axios.post(API_URL + "user/save-workout", workout, {
      headers: authHeader(),
    });
  },

  //  function for fetching workout history
  getWorkoutHistory() {
    return axios.get(API_URL + "user/workout-history", {
      headers: authHeader(),
    });
  },
};

export default UserService;
